import { useState, useEffect } from 'react'
import { Card, CardGroup, CardBody, CardTitle, CardSubtitle, CardText, Row, Col } from "reactstrap";
import SearchCar from './../Search/SearchCar'
import './CarsList.css'
import 'bootstrap/dist/css/bootstrap.min.css'

const apiUrl = 'http://localhost:8000/api/cars'

function CardList() {
    const [cars, setCars] = useState([])

    const getAllCars = async () => {
        try {
            const response = await fetch(apiUrl)
            const data = await response.json()
            setCars(data)

        } catch (error) {
            console.log(error);
        }
    }

    useEffect(() => {
        getAllCars()
    }, [])

    return (
        <div>
        <SearchCar />
            {cars.map((cars) => { 
                return (
                    <Row>
                <Col sm='6' lg='' >
                    <CardGroup>
                        <Card>
                            <CardBody>
                                <CardTitle tag="h5">
                                    <p>{cars.BRAND}</p>
                                </CardTitle>
                                <CardSubtitle
                                    className="mb-2 text-muted"
                                    tag="h6"
                                >
                                    <p>{cars.MODEL}</p>
                                </CardSubtitle>
                                <CardText>
                                    <p>{cars.DEALER}</p>
                                </CardText>
                                <CardText>
                                    <p>{cars.MIN_MILEAGE}</p>
                                </CardText>
                                <CardText>
                                    <p>{cars.MAX_MILEAGE}</p>
                                </CardText>
                            </CardBody>
                        </Card>
                    </CardGroup>
                </Col>
            </Row>
                )
            })}
        </div>
    )
}

export default CardList;
